import React, {useState } from 'react'
import ReactQuill from 'react-quill';
import 'react-quill/dist/quill.snow.css';
import EditorToolbar, { modules, formats } from "../EditorToolbar";
import {useHistory} from 'react-router-dom'
import axiosInstance from '../AuthComp/AxiosInstance';

const UpdateQ = (props) => {
    alert("Inside");
    const history = useHistory();
    const [ques, setques] = useState(props.q)
    const [ques_dta, setques_dta] = useState(props.qd)

    const sendData = () => {
        axiosInstance.post(`update-question/${history.location.pathname}`, {
            question : ques,
            question_data : ques_dta 
        }).then((res) => console.log(res))
    }
    return(
    <>
    <form onSubmit={(e) => e.preventDefault()}>
        <div className="form-group">
        <input type="text" value={ques} onChange={(e) => {setques(e.target.value)}} className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
        <br/>
        </div>
        </form>    
    <EditorToolbar toolbarId={'t1'}/>
    <ReactQuill
    theme="bubble"
    value={ques_dta}
    modules={modules('t1')}
    formats={formats}
    onChange={(event) => setques_dta(event)}
    />
    <button type='submit' className='btn btn success' onClick={sendData} >Update?</button>
        </>
        )
}

export default UpdateQ
